// This function is used to get turnover data of each type per second
const getTurnoverPerSecond = (data, type = 'buy') => {
  let turnoverPerSecondData = [];

  for(let i = data[0].date; i < data[data.length-1].date; i = i + 1000) {
    let rawDataPerSecond = data.filter(each => (each.date < (i+1000) && each.date >= i && each.type === type));

    let turnoverPerSecond = rawDataPerSecond.reduce((arr, each) => {
      return arr + each.price * each.amount;
    },0);
    // console.log(turnoverPerSecond);
    turnoverPerSecondData.push([
      Math.round(rawDataPerSecond[0].date/1000)*1000,
      Number.parseFloat(turnoverPerSecond.toFixed(2))]);
  }
  return turnoverPerSecondData;
};

// This function is used to get NET turnover data per second
const getNetTurnoverPerSecond = (data) => {
  let turnoverPerSecondData = [];

  for(let i = data[0].date; i < data[data.length-1].date; i = i + 1000) {
    let rawDataPerSecondBuy = data.filter(each => (each.date < (i+1000) && each.date >= i && each.type === 'buy'));

    let turnoverPerSecondBuy = rawDataPerSecondBuy.reduce((arr, each) => {
      return arr + each.price * each.amount;
    },0);

    let rawDataPerSecondSell = data.filter(each => (each.date < (i+1000) && each.date >= i && each.type === 'sell'));

    let turnoverPerSecondSell = rawDataPerSecondSell.reduce((arr, each) => {
      return arr + each.price * each.amount;
    },0);
    // console.log(turnoverPerSecond);
    turnoverPerSecondData.push([
      Math.round(rawDataPerSecondBuy[0].date/1000)*1000,
      Number.parseFloat((turnoverPerSecondBuy-turnoverPerSecondSell).toFixed(2))]);
  }

  return turnoverPerSecondData;
}

export const bitcoinTurnoverPerSecondWithTypeBuy = getTurnoverPerSecond(bitcoin, 'buy');
export const bitcoinTurnoverPerSecondWithTypeSell = getTurnoverPerSecond(bitcoin, 'sell');
export const bitcoinTurnoverPerSecondNet = getNetTurnoverPerSecond(bitcoin);

